description:
Hi my names Tyler Kefford i&amp;#039;m a rock solo artist.

I have just finished recording my first studio release which is a five track EP (extended play) disc titled &quot;Insomniac Release&quot;.

Each song on the EP was crafted based on the fresh inspiration of events occurring in my life as they were developing.

I covered many experiences such as the feelings of frustration towards the political agenda&amp;#039;s in today&amp;#039;s worlds, my experiences with drugs, dealing with two faced people and just general teenage angst.

But now after coming out of it all I can look back and know that thanks to myself and the people surrounding me i was able to capture many extreme moments in my life and express them as a form of art.

Please enjoy my music :)

Many thanks, Tyler Kefford. 


